import React from 'react'

export default function TarjetaAuditoria(auditoria) {
    return (
        <div className="card x-depth-0 tarjeta-auditoria">
            <div className="card-content grey-text text-darken-3">
                <span className="card-title">{auditoria.auditoria}</span>
                <p>Auditor: {auditoria.auditor}</p>
                <p className="grey-text">Due date: {auditoria.fecha_fin}</p>
            </div>
        </div>
    )
}
